<style>
html {
    zoom:0.95;
}

body {
    width: 100%;
    height: 100%;







}

* {
    color: #ffffff;
    font-size: 12px;
    font-family: Arial, sans-serif;
    
    /* DebugMode:delete next line to show dashed border */
    /*
    border: 1px dashed gray;/**/
    
}

*:not(input,checkbox,textarea) {
    /*禁止文本选择*/
   -webkit-touch-callout: none;
   -webkit-user-select: none;
   user-select: none; /* Non-prefixed version, currently */
   outline: none;
   -webkit-tap-highlight-color: transparent;
}

input {
    background-color: rgba(0,0,0,0);
    height: 30px;
}

button {
    height: 30px;
    background-color: #E8E8E850;
    display: inline-block;
    cursor: pointer;
    text-align: center;
    text-decoration: none;
    outline: none;
    border: none;
    border-radius: 5px;
}






button:active {
     transform: translateY(2px);
}

input[type=radio]  {
    width:20px;
    height:20px;
    margin-right:6px;
    border:none;
    outline-style:none;
    -webkit-appearance:none;
    vertical-align:middle;
    border:1px solid #DDDDDDF0;
    border-radius:50%;
}
input[type=radio]:checked {
    border:6px solid #2F7DCDF0;
    background:#FFFFFF;
}
    
input[type=checkbox]{
 visibility: hidden;
 vertical-align:middle; margin-bottom:2px;
 cursor: pointer;
 position: relative;
 width: 24px;
 height: 24px;
}
input[type=checkbox]::after{
 position: absolute;
 top: 0;
 margin-top:2px;
 width: 14px; height: 14px;
 border: 1px solid #EEEEEE;
 border-radius: 3px;
 background-color: rgba(0,0,0,0);
 display: inline-block;
 visibility: visible;
 text-align: center;
 content: ' ';
}
input[type=checkbox]:checked::after{
 content: "✓";
 border-color: #000;
 background-color: #000;
 font-size: 12px;
 font-weight: bold;
}

input[type=range] {
  -webkit-appearance: none;
}
input[type=range]:focus {
  outline: none;
}
input[type=range]::-webkit-slider-runnable-track {
  height: 15px;
  cursor: pointer;
  animate: 0.2s;
  background: #D1D1D130;
  border-radius: 1.3px;
  border: 0.2px solid #010101;
}
input[type=range]::-webkit-slider-thumb {
  border: 1px solid #ff0000;
  height: 18px;
  width: 16px;
  border-radius: 3px;
  background: #FFFFFFE0;
  cursor: pointer;
  -webkit-appearance: none;
  margin-top: -2px;
}
input[type=range]:focus::-webkit-slider-runnable-track {
  background: #367ebd;
}



    
/* 滾動條整體部分 */
.scrollbar {
    overflow-x: hidden;
    overflow-y: auto;
    -webkit-overflow-scrolling: touch;
}
.scrollbar::-webkit-scrollbar {
    width: 5px; /* 縱向滾動條寬度 */
    height: 5px;/* 橫向滾動條高度 */
    background-color: #F5F5F5; /* 滾動條整體背景，一般被覆蓋著 */
}
/* 滾動條的軌道（裡面裝有Thumb） */
.scrollbar::-webkit-scrollbar-track {
    -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,0.3); /* 滾動條軌道陰影 */
    /*border-radius: 10px; /* 滾動條軌道圓角 */
    background-color: #F5F5F5; /* 滾動條軌道背景 */
}
/* 滾動條裡面的滑塊 */
.scrollbar::-webkit-scrollbar-thumb {
    border-radius: 15px; /* 滾動條滑塊圓角 */
    -webkit-box-shadow: inset 0 0 6px rgba(0,0,0,.3); /* 滾動條滑塊陰影 */
    background-color: #0ffff3; /* 滾動條滑塊顏色 */
}
    
.menubox {
        width: 60px;
        height: 30px;
        line-height: 30px;
        text-align:center;
}
.menubox.current {
    background-color: #494949;
}

.menuview {
    display:none;
}

.menuview.current {
    display:block;
    overflow-x: hidden;
    overflow-y: scroll;
    height: 100%;
}
.rainbow {
    animation: rainbow 1s linear infinite;
}

@keyframes rainbow {
    0% {
        color: #ff0000;
    }

    10% {
        color: #ff7f00;
    }

    20% {
        color: #ffff00;
    }

    30% {
        color: #00ff00;
    }

    40% {
        color: #00ffff;
    }

    50% {
        color: #0000ff;
    }

    60% {
        color: #8b00ff;
    }

    70% {
        color: #ff00ff;
    }

    80% {
        color: #ff007f;
    }

    90% {
        color: #ff0000;
    }
    100% {
        color: #98ff19;
    }
    110% {
        color: #ff19b6;

}

.／rainbow-text {
    display: inline-block;

}
